import React, { Component } from "react";
import ReactDOM from "react-dom";

class Search extends Component {
  state = {};

  render() {
    var input = document.getElementById("myInput");

    if (input) {
      alert("Hello World!");
      input.addEventListener("keyup", function(event) {
        if (event.keyCode === 13) {
          event.preventDefault();
          alert("Hello World!");
        }
      });
    }
    return (
      <React.Fragment>
        <input
          type="text"
          placeholder="Class"
          id="myInput"
          onChange={this.myChangeHandler}
        />
        <form id="form" onsubmit="">
          <p>
            <i>
              {" "}
              <input
                type="text"
                className="input"
                placeholder="Class"
                id="classInput"
              />
            </i>
            <i>
              <input
                type="text"
                className="input"
                placeholder="Search..."
                id="searchInput"
              />{" "}
            </i>
          </p>
          <input type="submit" onclick="cname();" />
        </form>
      </React.Fragment>
    );
  }
}

export default Search;

function cname() {
  var cinput = document.getElementById("classInput").value;
  alert("dscdscdscdscs");
}

function sname() {
  var sinput = document.getElementById("searchInput").value;
  alert(sinput);
}
